import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import Navbar from './components/Navbar';
import Home from './pages/Home';
import Login from './pages/Login';
import Signup from './pages/Signup';
import Profile from './pages/Profile';
import AdminDashboard from './pages/AdminDashboard';
import Cart from './pages/Cart';

function App() {
  const isUserSignedIn = !!localStorage.getItem('token'); // Check if the user is signed in

  return (
    <Router>
      <Navbar />
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/login" element={isUserSignedIn ? <Navigate to="/" /> : <Login />} />
        <Route path="/signup" element={isUserSignedIn ? <Navigate to="/" /> : <Signup />} />
        <Route path="/profile" element={isUserSignedIn ? <Profile /> : <Navigate to="/login" />} />
        <Route path="/cart" element={<Cart />} />

        {/* Admin route */}
        <Route
          path="/admin"
          element={isUserSignedIn ? <AdminDashboard /> : <Navigate to="/login" />}
        />
      </Routes>
    </Router>
  );
}

export default App;
